import React from "react";
import { Text, StyleSheet,View,TextInput,Image,Button,ScrollView,ImageBackground} from "react-native";
import { TouchableOpacity } from "react-native-gesture-handler";

import * as firebase from 'firebase';
import '@firebase/firestore';
import { FrameAttribute } from "expo/build/AR";

const image = { uri: "https://reactjs.org/logo-og.png" };


class SingUp extends React.Component {



	constructor(props) {
    super(props)

    this.state = {
      Username: '',
      phone: '',  
      Email: '',
      Password: '',
      configPassword: '',
    
  };

  var config = {
    //apiKey: "AIzaSyBOD-s6Y5Q1zeG1nwYMEmSSfYmXj1OQTFQ",
    apiKey: "AIzaSyA-UirMQvJgS9zqkbXsMTYkgaFytVwMor8",
      authDomain: "h-maintenace-qatar.firebaseapp.com",
      databaseURL: "https://h-maintenace-qatar.firebaseio.com",
      projectId: "h-maintenace-qatar",
      storageBucket: "h-maintenace-qatar.appspot.com",
      messagingSenderId: "493679119110",
      appId: "1:493679119110:web:5de61a5086d5e5ba55ec87",
      measurementId: "G-FK58DXMCRY"
 };

if (!firebase.apps.length){
   firebase.initializeApp(config);
   console.log('Good');
}

	}
  onbuttonSignIn (navigation){
    

    console.log( "jdssddsddddddddd: "+this.state.Email);
    var dbh = firebase.firestore();

    dbh.collection('test').add({
    email:this.state.Email,
    password: this.state.Password,
    phon:this.state.phone,
    username:this.state.Username,
    }).catch(function(error) {
      console.log(error);
    });
      console.log( this.state.Username);

    // navigation.navigate('Homes');

 }
render(){

  const { navigation } = this.props.navigation;
  // console.log(this.props);
  return     (   
  
  
    <ScrollView style={[styles.scroll]}>
            

      <View style={[styles.container,{marginTop:"33%"}]}>
    
 
       <View style={styles.TextLeft}>

       </View>  
       <View style={styles.Centers}>
       <TextInput  style={styles.inputBox}
         underlineColorAndroid="rgba(0,0,0,0)"
         placeholder="Enter Username"
         onChangeText={text => this.setState({ Username: text })}

        >
        </TextInput >
        <TextInput  style={styles.inputBox}
         underlineColorAndroid="rgba(0,0,0,0)"
         placeholder="Enter Username"
         onChangeText={text => this.setState({ Username: text })}

        >
        </TextInput >
       </View> 

       <View style={styles.Centers}>
        <TextInput  style={styles.inputBox}
         underlineColorAndroid="rgba(0,0,0,0)"
         placeholder="Enter phone"
         onChangeText={text => this.setState({ phone: text })}

        >
        </TextInput >
       </View> 
       
       <View style={styles.Centers}>
       <TextInput  style={styles.inputBox}
       underlineColorAndroid="rgba(0,0,0,0)"
       placeholder="Enter Email"
       onChangeText={text => this.setState({ Email: text })}

       
       >
       </TextInput >
       </View> 


       <View style={styles.Centers}>
       <TextInput  style={styles.inputBox}
       underlineColorAndroid="rgba(0,0,0,0)"
       placeholder="Enter Password"
       
       onChangeText={text => this.setState({ Password: text })}

       >
       </TextInput >
       </View> 

       <View style={styles.Centers}>
       <TextInput  style={styles.inputBox}
       underlineColorAndroid="rgba(0,0,0,0)"
       placeholder="Enter configPassword"
       onChangeText={text => this.setState({ configPassword: text })}

       >
       </TextInput >
       </View> 


       <View style={styles.Centers}>
       <View style={styles.ButtonLogin}> 
       <TouchableOpacity  style={styles.textSingUp} onPress={() => this.onbuttonSignIn(this.props.navigation)}>
         <Text style={styles.buttonText}>Sign Up</Text>
       </TouchableOpacity>
       </View>
       </View>



    </View>

  </ScrollView> 
  )
    ;

 
}
}
 const styles = StyleSheet.create({
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  }, text: {
    fontSize: 20,
    color:"#000"
  },
  scroll:{

    
  backgroundColor:"#fff",
  
  },
  container :{

    justifyContent:"center",
    backgroundColor:"#fff",

    flex:1,
    height:'100%',
    
 
 
  },
  inputBox :{
    

    backgroundColor:"transparent",
    paddingHorizontal:"11%",
    paddingVertical:"4%",
    fontSize:20,
    
    marginBottom:"2%",
    width:"90%",
    borderBottomColor: "#000",
    borderTopEndRadius:70,
    borderBottomWidth: 3,
    color:"#000",
  },

  TextInputBox:{
    paddingLeft:31,
    textAlign: 'left',
    fontSize:20,
    fontWeight:'500',
    color:"#fff",


  },
  Img :{
    
    alignItems:"center",
    paddingTop:"2%",
    marginTop:"25%",
    marginBottom:"10%",
    width:85,
    height:85,
    paddingVertical:50,
    

  },Img1:{
    paddingTop:12,
   alignItems:"center"

 },

  Centers:{

    alignItems:"center"


  },ButtonLogin:{
    
    marginTop:"10%",
    height:"35%",
    backgroundColor:"#011",
    width:"90%",

    borderRadius:50,  
  },textSingUp:{

     
    fontSize: 20,
    marginVertical:10,
    paddingVertical:16,
    borderRadius:50,  


  },

  buttonText :{
   fontSize:16,
   fontWeight:'500',
   color:"#fff",
   textAlign:"center",
    
  }

});



export default SingUp;
